import { Component, OnInit, OnDestroy, ElementRef, AfterViewInit } from '@angular/core';
import { SharedService } from '../shared/services/shared.service';
import { ActivatedRoute, Router } from '@angular/router';
import * as jsPDF from 'jspdf';
import * as html2canvas from 'html2canvas';
import { UserService } from '../user/user.service';
import { DomSanitizer } from '@angular/platform-browser';
import { MatDialog } from '@angular/material';
import { BankDetailsComponent } from '../bank-details/bank-details.component';

@Component({
  selector: 'app-results',
  templateUrl: './results.component.html',
  styleUrls: ['./results.component.scss']
})
export class ResultsComponent implements OnInit, OnDestroy, AfterViewInit {

  voucherCode = '';
  username = '';
  voucherAmount = '';
  correctAnswers: any;
  imagePath = '';

  constructor(
    public shared: SharedService,
    private activatedRoute: ActivatedRoute,
    private router: Router,
    private elementRef: ElementRef,
    private user: UserService,
    private _sanitizer: DomSanitizer,
    private dialog: MatDialog
  ) {
    this.user.getUser(this.activatedRoute.snapshot.params.user).subscribe(
      username => {
        this.username = username;
      }
    );
    this.voucherCode = this.activatedRoute.snapshot.params.voucherCode;
    this.correctAnswers = this.activatedRoute.snapshot.params.correctAnswers;

    if (this.correctAnswers === '8' || this.correctAnswers === '9') {
      this.voucherAmount = '200';
    } else if (this.correctAnswers === '10') {
      this.voucherAmount = '300';
    }
  }

  ngOnInit() { }


  ngOnDestroy() {
    localStorage.clear();
    this.router.navigate(['/home']);
    this.correctAnswers = '';
    this.shared.user_id = '';
    this.shared.total_correct_answer = '';
    this.shared.correctAnswers = 0;
    this.shared.voucher = '';
  }

  submitbankdetails() {
    // this.router.navigate(['/bank', this.username, this.voucherCode]);
    this.dialog.open(BankDetailsComponent, {
      width: '80rem',
      height: '80rem',
      data: {
        voucher: this.voucherCode,
        user: this.username
      }
    });
  }


  downloadVoucherForLoser () {
    const doc = new jsPDF();
    const imgData = 'data:image/jpeg;base64,';
    const user = this.username;
    doc.setFontSize(18);
    doc.setTextColor('#223657');
    doc.setFontType('italic');
    doc.addImage(imgData, 'JPEG', 0, 40, 210, 160);
    doc.text(98, 129, user);
    doc.output('datauri');
    doc.save('rkm_voucher.pdf');
    this.router.navigate(['/home']);
  }



  

  ngAfterViewInit() {
    // this.elementRef.nativeElement.ownerDocument.body.style.background = 'url("/assets/quiz_images/design_images/water_mark.jpg")';
  }

}
